import React, { Component } from 'react';
import Iframe from 'react-iframe'

import iconDownload from './img/google-play-badge.png'

import './styles.scss';

class ComoFunciona extends Component {
    render() {
        return (

            <section className="containerComoFunciona"> 
                <div className="contentComoFunciona">
                    <div className="headerComoFunciona">
                        <h1>Aperte o play e saiba como desafiar, duelar e conquistar</h1>
                        <p>Novo por aqui? Assista ao v√≠deo abaixo sobre como funciona o nosso app e saiba como conquistar o universo dos games e ganhar na vida real tanto nas modalidades Gold Star e Red Star!</p>
                        <img className="image" src={iconDownload} alt="Icon Download Google Play" />
                    </div>
                    <div className="containerVideo">
                        <Iframe
                            className="iFrame"
                            title="Video Como Funciona"
                            src="https://www.youtube.com/embed/SXMzfVInOaA"
                            frameBorder="0"
                            allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
                            allowFullScreen
                        />
                    </div>

                </div>
            </section>
        )
    }
}

export default ComoFunciona;
